import React from 'react'
import logo from '../../src/img/logo.png'


export default function Pagina1() {
    return (
      <div>
        <h1>Cardapio</h1>
        <h3>EXFOMEADOS</h3>

        <div className='container-cardapio'>

        <img height="90%" src={logo} alt="logo"></img> <br></br>

          

        </div>

      </div>
    );
}
